import React from 'react';
import './sign-in.styles.scss'

class Signin extends React.Component{
    constructor(){
        super()
        this.state = {
            email:"",
            password:""
        }
    }

    handleChange(prop){
        this.setState(prop)
    }

    render(){
        return
        <form>
            <input onChange={this.handleChange}>Email</input>
            <input onChange={this.handleChange}>Password</input>
        </form>
    }
}

export default Signin;
